import React from 'react';
import './ProfilePage.css';
import { useNavigate } from 'react-router-dom';

const ProfilePage = ({ name, email, loggedIn }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Simulate logout then redirect (replace this with your real logout logic)
    // e.g. clear auth token, call logout API, etc.
    navigate('/logout');
  };

  return (
    <div className="container">
      <div className="logo">GrowAndCheer</div>

      <div className="card">
        <h1>Selamat Datang, <span>{name}</span>!</h1>

        <div className="profile-info">
          <div className="info-item">
            <span className="info-label">Email</span>
            <span className="info-value">{email}</span>
          </div>
          <div className="info-item">
            <span className="info-label">Login Status</span>
            <span className="info-value">{loggedIn ? 'Logged In' : 'Logged Out'}</span>
          </div>

          {/* Uncomment to show roles later
          <div className="roles">
            <div className="roles-title">Your Roles:</div>
            <ul className="roles-list">
              {roles.map((r, i) => (
                <li key={i} className="role-item">{r}</li>
              ))}
            </ul>
          </div> */}
        </div>

        <div className="button-container">
          <button onClick={handleLogout} className="button danger">Logout</button>
        </div>
      </div>

      <div className="footer">
        Â© 2025 GrowAndCheer. All rights reserved.
      </div>
    </div>
  );
};

export default ProfilePage;
